import React, { useState, useEffect } from 'react';
import './App.css';
import HotelList from './components/HotelList';
import ParkList from './components/ParkList';
import Navbar from './components/NavBar';
import { Route, Switch } from 'react-router-dom';
import Login from './components/Login';
import About from './components/About';
import AddPark from './components/AddPark';
import AddHotel from './components/AddHotel';
import Contacts from './components/Contacts';
import UpdateHotels from './components/UpdateHotels';
import UpdateParks from './components/UpdateParks';
import Bookings from './components/Bookings';
import Signup from './components/Signup';

function App() {
  const [hotels, setHotels] = useState([])
  const [parks, setParks] = useState([])

  // fetch hotels data
  useEffect(() => {
    fetch("/hotels")
    .then(r => r.json())
    .then(data => setHotels(data))
  }, [])

  // fetch parks data
  useEffect(() => {
    fetch("/parks")
    .then(r => r.json())
    .then(data => setParks(data))
  }, [])

  // delete park
  function DeletePark() {
    fetch('/park', {
      method: 'DELETE',
      headers: {
        'Content-Type': 'application/json'
      }
    })
      .then((response) => {
        if (response.ok) {
          console.log('Park deleted successfully');
        } else {
          // Request was not successful
          throw new Error('Failed to delete park');
        }
      })
      .catch((error) => {
        console.error('Error:', error);
      });
  }

  // delete hotel
