    },
    body:JSON.stringify(park)
  })
  .then(r => {
    if (r.ok){
      alert("Park added Sucessfully")
      console.log(r)
    }
  })
}
// Add hotel
const addHotel = (hotel) => {
  fetch("/hotels", {
    method:"POST",
    headers:{
      "Accept": "application/json",
      "Content-Type":"application/json"
    },
    body:JSON.stringify(hotel)
  })
  .then(r => {
    if (r.ok){
      alert("Hotel added Successfully")
      console.log(r)
    }
  })
}



  return (
    <div className="App">
      <header style={{textAlign:"center", backgroundColor:"lightgreen", fontSize:"35px"}}>Jambo-Journeys App</header>
      <Navbar />
    <Switch>
    <Route path="/parks">
    <ParkList parks = {parks}/>
    </Route>
    <Route path="/hotels">
    <HotelList hotels={hotels}/>
    </Route>
    <Route path="/about">
    <About/>
    </Route>
    <Route path="/addparks">
    <AddPark addPark={addPark}/>
    </Route>
    <Route path="/addhotels">
    <AddHotel addHotel={addHotel}/>
    </Route>
    <Route path="/contacts">
    <Contacts/>
    </Route>
    <Route path="/updhotel">
    <UpdateHotels/>
    </Route>
    <Route path="/updpark">
    <UpdateParks/>
    </Route>
    <Route path="/bookings">
    <Bookings/>
    </Route>
    <Route path="/oneprk">
    <DeletePark/>
    </Route>
    <Route path="/onehtl">
    <DeleteHotel/>
    </Route>
    <Route path="/signup">
    <Signup/>
    </Route>
    <Route exact path="/">
    <Login />
    </Route>
    </Switch>

    </div>
  );
}

export default App;
